-- ----------------------------
-- Table structure for topup
-- ----------------------------
DROP TABLE IF EXISTS `topup`;
CREATE TABLE `topup` (
  `id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'ID',
  `payment_identifier` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '支付方式id',
  `payment_name` varchar(255) DEFAULT NULL,
  `recharge_type` int DEFAULT NULL COMMENT '充值方案类型',
  `source` int DEFAULT NULL COMMENT '充值来源',
  `customer_id` varchar(32) DEFAULT NULL COMMENT '客户id',
  `user_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '客户用户名',
  `tran_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '流水号',
  `topup_amount` decimal(10,2) DEFAULT NULL COMMENT '充值金额',
  `paid_amount` decimal(10,2) DEFAULT NULL COMMENT '支付金额',
  `arrival_amount` decimal(10,2) DEFAULT NULL COMMENT '到账金额',
  `give` decimal(10,2) DEFAULT NULL COMMENT '赠送金额',
  `minus` decimal(10,2) DEFAULT NULL COMMENT '立减金额',
  `discount` decimal(10,2) DEFAULT NULL COMMENT '服务费打折数量',
  `topup_time` datetime DEFAULT NULL COMMENT '充值时间',
  `pay_time` datetime DEFAULT NULL COMMENT '付款时间',
  `pay_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '付款id',
  `state` int DEFAULT NULL COMMENT '启用/停用',
  `note` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '描述',
  `tenant_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '租户编号',
  `create_by` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '创建者',
  `create_dept` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '创建部门',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='充值方案';

